import React from 'react';
import LoadingOverlay from 'react-loading-overlay';
import './App.css';
import logo from './logo_kinea.png'

var Loader = require('react-loader');

class EditExtracted extends React.Component {
constructor(props) {
    super(props);
    this.state = {
        'data': props.data, //passed prop as initial value
    }
    this.submit = {}
    this.check = {}
    // this.handleInputChange = this.handleInputChange.bind(this);
    this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit(e) {
        e.preventDefault();
        let final = {}
        for (let i in this.submit){
            // if ()
            final[this.submit[i].name] = this.submit[i].value
        }
        console.log(final)
        // console.log(this.tipico_check.checked)
        // if (this.tipico_check.checked) { console.log(this.tipico.value)}
        // else{ console.log(this.tipico.defaultValue)}
        // console.log(this)
    }

    // handleInputChange(event) {
    //     const target = event.target;
    //     // const value = target.type === 'checkbox' ? target.checked : target.value;
    //     const value = target.value;
    //     const name = target.name;

    //     // this.setState({
    //     //   [name]: value
    //     // });
    //     this.setState(final => ({
    //         ...final,
    //         [name]: value}))
    //     // console.log(this.state)
    //   }

   to_list() {
    let lista = [];
    for (var key in this.props.data.pdfContent.raw) {
        lista.push([key,this.props.data.pdfContent.raw[key],this.props.data.pdfContent.tratado[key]])
    }
    return lista
    }

  render() {
    //   console.log(this.props.data.pdfContent.raw)
    // let items = this.to_list()
    // let itemList=items.map((item)=>{
    //     return(
    //         <div className='card_data'>
    //              <h4 className='title'>{item[0]}</h4>
    //              <p className='subtitle'>{item[1]}</p>
    //              <input type='text' className='data_edit' defaultValue={item[2]}></input>
    //          </div>
    //     ) 
    //   })

        let itemList=this.props.data.pdfContent.raw.descontos.map((item)=>{
            //console.log(item)
        return(
            <div className='card_data'>
                 <h4 className='title'>Desconto</h4>
                 <p className='subtitle'>Prazo</p>
                 <input type='text' className='data_edit' defaultValue={item.periodo[0]}></input>
                 <input style={{marginLeft: 6 + 'px'}} type='text' className='data_edit' defaultValue={item.periodo[1]}></input>
                 <p className='subtitle'>Valor</p>
                 <input type='text' className='data_edit' defaultValue={item.desconto}></input>
             </div>
        ) 
      })
    return (
      <div className='total_grid'>
        <h1 className='title2' >Confira o Conteúdo Extraído</h1>
        <form>
        <div className='data_grid'>
            <div className='card_data'>
                <h4 className='title'>Contrato Típico</h4>
                <p className='subtitle'>{this.props.data.pdfContent.raw.tipico}</p>
                {/* onChange={this.handleInputChange}  */}
                <input name='tipico' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.tipico} ref={(c) => this.submit.tipico = c}></input>
                <label className='alterado_check'><input className='alterado_check' type='checkbox' ref={(c) => this.check.tipico = c} />Alterado</label>       

            </div>
            <div className='card_data'>
                <h4 className='title'>Locatária</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.locataria}</p>
                <input name = 'locataria' type='text' className='data_edit_big' defaultValue={this.state.data.pdfContent.tratado.locataria} ref={(c) => this.submit.locataria = c}></input>
                <label className='alterado_check'><input className='alterado_check' type='checkbox'  />Alterado</label>
            </div>
            <div className='card_data'>
                <h4 className='title'>Tipo do imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.tipo_imovel}</p>
                <input name = 'tipo_imovel' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.tipo_imovel} ref={(c) => this.submit.tipo_imovel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Nome do Imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.nome }</p>
                <input name = 'nome' type='text' className='data_edit_big' defaultValue={this.state.data.pdfContent.tratado.nome } ref={(c) => this.submit.nome = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Área do Imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.area}</p>
                <input name = 'area' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.area} ref={(c) => this.submit.area = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Andar ou Galpão</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.andar || this.state.data.pdfContent.raw.galpao }</p>
                <input name = 'andar_galpao' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.andar ||this.state.data.pdfContent.tratado.galpao} ref={(c) => this.submit.andar_galpao = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Pavimento/Torre ou Docas</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.torre || this.state.data.pdfContent.raw.docas }</p>
                <input name = 'torre_pavimento' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.torre || this.state.data.pdfContent.tratado.docas} ref={(c) => this.submit.torre_docas = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Vagas</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.vagas }</p>
                <input name = 'vagas' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.vagas } ref={(c) => this.submit.vagas = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Início Vigência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.inicio_vigencia }</p>
                <input name = 'inicio_vigencia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.inicio_vigencia } ref={(c) => this.submit.inicio_vigencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Fim Vigência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.fim_vigencia }</p>
                <input name = 'fim_vigencia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.fim_vigencia } ref={(c) => this.submit.fim_vigencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Valor Aluguel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.valor_aluguel }</p>
                <input name = 'valor_aluguel' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.valor_aluguel } ref={(c) => this.submit.valor_aluguel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data de Reajuste</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_reajuste }</p>
                <input name = 'data_reajuste' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_reajuste } ref={(c) => this.submit.data_reajuste= c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data Início da Carência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_inicio_carencia}</p>
                <input name = 'data_inicio_carencia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_inicio_carencia } ref={(c) => this.submit.data_inicio_carencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Período da Carência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.periodo_carencia}</p>
                <input name = 'periodo_carencia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.periodo_carencia } ref={(c) => this.submit.periodo_carencia = c}></input>
            </div>
            {itemList}
            <div className='card_data'>
                <h4 className='title'>Reajuste Positivo</h4>
                {/* <p className='subtitle'>{this.props.data.pdfContent.raw.reajuste_positivo}</p> */}
                <input name = 'reajuste_positivo' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.reajuste_positivo } ref={(c) => this.submit.reajuste_positivo = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Índice do Reajuste</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.indice}</p>
                <input name = 'indice' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.indice } ref={(c) => this.submit.indice = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Forma de Pagamento</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.pagamento_aluguel}</p>
                <input name = 'pagamento_aluguel' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.pagamento_aluguel } ref={(c) => this.submit.pagamento_aluguel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data de Pagamento do Aluguel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_pagamento_encargos}</p>
                <input name = 'data_pagamento_encargos' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_pagamento_encargos } ref={(c) => this.submit.data_pagamento_encargos = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Garantia</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.garantia}</p>
                <input name = 'garantia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.garantia} ref={(c) => this.submit.garantia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Valor da Garantia</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.valor_garantia}</p>
                <input name = 'valor_garantia' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.valor_garantia} ref={(c) => this.submit.valor_garantia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Aviso Prévio</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.aviso_previo}</p>
                <input name = 'aviso_previo' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.aviso_previo} ref={(c) => this.submit.aviso_previo = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Multa por Rescisão Antecipada</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.multa_rescisao_antecipado}</p>
                <input name = 'rescisao_antecipada' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.multa_rescisao_antecipado} ref={(c) => this.submit.multa_rescisao_antecipado = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Multa Proporcional</h4>
                {/* <p className='subtitle'>{this.props.data.pdfContent.raw.proporcional}</p> */}
